function ToggleShopItem(n,t){$.get("/ShoppingLists/ToggleShopItem?product_id="+n+"&unitString="+t,function(){divId="ShopItem-"+n+t;className="shopItemBought";console.log("Toggle: "+divId);var i=document.getElementById(divId);i.classList.contains(className)?(console.log("Remove: "+divId),i.classList.remove(className)):(console.log("Add: "+divId),i.classList.add(className))})}function addRecipe(){var n=document.getElementById("RecipeList"),t=document.getElementsByName("RecipeRow")[0],i=t.cloneNode(!0);n.appendChild(i)}function addProduct(){var n=document.getElementById("ProductList"),t=document.getElementsByName("ProductRow")[0],i=t.cloneNode(!0);n.appendChild(i)}